import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './bookmarks.css';

const Bookmarks = () => {
  const [activeTab, setActiveTab] = useState('bookmarks');
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);
  const navigate = useNavigate();

  // Sample bookmarked addresses data
  const bookmarkedAddresses = [
    {
      id: 1,
      address: '123 Maple Street, Anytown, CA',
      type: 'Home',
      mapImage: 'https://images.unsplash.com/photo-1560472354-b33ff0c44a43?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      address: '456 Oak Avenue, Anytown, CA',
      type: 'Investment',
      mapImage: 'https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?w=300&h=200&fit=crop'
    },
    {
      id: 3,
      address: '789 Pine Lane, Anytown, CA',
      type: 'Vacation',
      mapImage: 'https://images.unsplash.com/photo-1497366216548-37526070297c?w=300&h=200&fit=crop'
    }
  ];

  // Sample bookmarked predictions data
  const bookmarkedPredictions = [
    {
      id: 1,
      address: '123 Maple Street, Anytown, CA',
      prediction: 'Sales Prediction: $850,000',
      bookmarkedDate: '2024-01-15',
      image: 'https://images.unsplash.com/photo-1564013799919-ab600027ffc6?w=300&h=200&fit=crop'
    },
    {
      id: 2,
      address: '456 Oak Avenue, Anytown, CA',
      prediction: 'Rental Prediction: $3,500/month',
      bookmarkedDate: '2024-02-20',
      image: 'https://images.unsplash.com/photo-1545324418-cc1a3fa10c00?w=300&h=200&fit=crop'
    },
    {
      id: 3,
      address: '789 Pine Lane, Anytown, CA',
      prediction: 'Sales Prediction: $1,200,000',
      bookmarkedDate: '2024-03-10',
      image: 'https://images.unsplash.com/photo-1512917774080-9991f1c4c750?w=300&h=200&fit=crop'
    }
  ];

  const navigationItems = [
    { id: 'dashboard', label: 'Dashboard', icon: 'üè†' },
    { id: 'price-prediction', label: 'Price Prediction', icon: 'üìà' },
    { id: 'bookmarks', label: 'Bookmarks', icon: 'üîñ' },
    { id: 'support', label: 'Support', icon: '‚ùì' },
    { id: 'feedback', label: 'Feedback', icon: 'üí¨' },
    { id: 'profile', label: 'Profile', icon: 'üë§' }
  ];

  const handleProfileClick = () => {
    setShowProfileDropdown(!showProfileDropdown);
  };

  const handleProfilePage = () => {
    setShowProfileDropdown(false);
    navigate('/profile');
  };

  const handleLogout = () => {
    setShowProfileDropdown(false);
    localStorage.removeItem('isLoggedIn');
    localStorage.removeItem('userType');
    localStorage.removeItem('userPreferences');
    navigate('/login');
  };

  const handleClickOutside = (e) => {
    if (!e.target.closest('.user-profile')) {
      setShowProfileDropdown(false);
    }
  };

  const handleNavigation = (itemId) => {
    setActiveTab(itemId);
    
    switch (itemId) {
      case 'dashboard':
        navigate('/dashboard/free');
        break;
      case 'price-prediction':
        navigate('/dashboard/priceprediction');
        break;
      case 'bookmarks':
        navigate('/bookmarks');
        break;
      case 'support':
        navigate('/support');
        break;
      case 'feedback':
        navigate('/feedback');
        break;
      case 'profile':
        navigate('/profile');
        break;
      default:
        break;
    }
  };

  const handleRemoveBookmark = (type, id) => {
    // Here you would typically remove from localStorage or send to backend
    console.log(`Removing ${type} bookmark with id:`, id);
  };

  // Add click listener to close dropdown when clicking outside
  useEffect(() => {
    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, []);

  return (
    <div className="bookmarks-dashboard">
      {/* Top Header */}
      <header className="dashboard-header">
        <div className="header-center">
          <div className="logo">
            <span className="logo-icon">üè†</span>
            <span className="logo-text">Valuez</span>
          </div>
        </div>
        <div className="header-right">
          <div className="notification-icon">üîî</div>
          <div className="user-profile">
            <img 
              src="https://images.unsplash.com/photo-1494790108755-2616b612b786?w=40&h=40&fit=crop&crop=face" 
              alt="User Profile" 
              className="profile-image"
              onClick={handleProfileClick}
            />
            {showProfileDropdown && (
              <div className="profile-dropdown">
                <div className="dropdown-item" onClick={handleProfilePage}>
                  <span className="dropdown-icon">üë§</span>
                  <span>Profile</span>
                </div>
                <div className="dropdown-divider"></div>
                <div className="dropdown-item" onClick={handleLogout}>
                  <span className="dropdown-icon">üö™</span>
                  <span>Logout</span>
                </div>
              </div>
            )}
          </div>
        </div>
      </header>

      <div className="dashboard-container">
        {/* Left Sidebar */}
        <aside className="sidebar">
          <nav className="sidebar-nav">
            {navigationItems.map((item) => (
              <button
                key={item.id}
                className={`nav-item ${activeTab === item.id ? 'active' : ''}`}
                onClick={() => handleNavigation(item.id)}
              >
                <span className="nav-icon">{item.icon}</span>
                <span className="nav-label">{item.label}</span>
              </button>
            ))}
            <div className="nav-divider"></div>
            <button className="nav-item logout-item" onClick={handleLogout}>
              <span className="nav-icon">üö™</span>
              <span className="nav-label">Logout</span>
            </button>
          </nav>
        </aside>

        {/* Main Content */}
        <main className="main-content">
          <div className="content-header">
            <h1 className="main-title">My Bookmarks</h1>
          </div>

          {/* Bookmarked Addresses */}
          <section className="bookmarked-addresses">
            <h2 className="section-title">Bookmarked Addresses</h2>
            <div className="bookmarks-grid">
              {bookmarkedAddresses.map((address) => (
                <div key={address.id} className="bookmark-card address-card">
                  <div className="card-map">
                    <img src={address.mapImage} alt={address.address} />
                    <button 
                      className="remove-bookmark-btn"
                      onClick={() => handleRemoveBookmark('address', address.id)}
                      title="Remove bookmark"
                    >
                      ‚úï
                    </button>
                  </div>
                  <div className="card-content">
                    <h3 className="card-address">{address.address}</h3>
                    <p className="card-type">{address.type}</p>
                  </div>
                </div>
              ))}
            </div>
          </section>

          {/* Bookmarked Predictions */}
          <section className="bookmarked-predictions">
            <h2 className="section-title">Bookmarked Predictions</h2>
            <div className="bookmarks-grid">
              {bookmarkedPredictions.map((prediction) => (
                <div key={prediction.id} className="bookmark-card prediction-card">
                  <div className="card-image">
                    <img src={prediction.image} alt={prediction.address} />
                    <button 
                      className="remove-bookmark-btn"
                      onClick={() => handleRemoveBookmark('prediction', prediction.id)}
                      title="Remove bookmark"
                    >
                      ‚úï
                    </button>
                  </div>
                  <div className="card-content">
                    <h3 className="card-address">{prediction.address}</h3>
                    <p className="card-prediction">{prediction.prediction}</p>
                    <p className="card-date">Bookmarked on {prediction.bookmarkedDate}</p>
                  </div>
                </div>
              ))}
                         </div>
           </section>
        </main>
      </div>

      {/* Footer */}
      <footer className="dashboard-footer">
        <div className="footer-left">
          <a href="/terms" className="footer-link">Terms</a>
          <a href="/privacy" className="footer-link">Privacy</a>
        </div>
        <div className="footer-center">
          <span className="copyright">¬© 2024 Valuez. All rights reserved.</span>
        </div>
        <div className="footer-right">
          <a href="/contact" className="footer-link">Contact</a>
          <a href="/disclaimer" className="footer-link">Disclaimer</a>
        </div>
      </footer>
    </div>
  );
};

export default Bookmarks;
